const userMap = {
  admin: {
    role: ['admin'],
    token: 'admin',
    nickName: '管理员',
    avatar: 'data:image/png;base64,',
    userName: 'Admin',
    userId: '001'
  },
  editor: {
    role: ['editor'],
    token: 'editor',
    nickName: '编辑',
    avatar: 'data:image/png;base64,',
    userName: 'Editor',
    userId: '002'

  },
  developer: {
    role: ['developer'],
    token: 'developer',
    nickName: '开发工程师',
    avatar: 'data:image/png;base64,',
    userName: 'Developer',
    userId: '003'
  }
}

export default {
  loginByEmail: config => {
    const { userName, password } = JSON.parse(config.data);
    return new Promise((resolve, reject) => {
      if (userMap[userName]) {
        setTimeout(() => {
          resolve([200, {
            success: true,
            data: userMap[userName]
          }]);
        }, 500);
      } else {
        reject('账号不正确')
      }
    })
  },
  getInfo: config => {
    const { token } = config.params;
    return new Promise((resolve, reject) => {
      if (userMap[token]) {
        setTimeout(() => {
          resolve([200, {
            success: true,
            data: userMap[token]
          }]);
        }, 100);
      } else {
        reject('获取失败')
      }
    })
  },
  logout: () => new Promise(resolve => {
    setTimeout(() => {
      resolve([200, { data: 'success' }]);
    }, 100);
  })
};
